text:
@WaltherAcosta5 Sin dudas, es un tema desconocido para el gran público.
Y también para la mayoría de los "periodistas".
Creo que ni siquiera es conocido como correspondería a los responsables de la encuestadora CIFRA.

@Soledad_Acunia Queda claro que muchos políticos argentinos no entienden lo que está sucediendo en su sociedad.
La ola les pasa por encima.
Por eso Milei crece día a día en apoyos, interpreta a sectores de la población que no aguantan más la corrección política y el discurso vacío.
